useEffect(() => { vidRef.current.play(); },[]);

<video
  src="/WelcomeVideo.mp4"
  ref={ vidRef }
  muted
  autoPlay
  loop 
/>
return (
    <div className={classes.home}>
       <video className={classes.home} autoplay>
        <source src={WelcomeVideo.mp4} type="video/mp4"/>
       </video>
    </div>
)
}

export default Home;
